  return ( 
  <Router>
    <nav>
      <Link to="/">Home</Link>
      <Link to="launch">Launch</Link>
    </nav>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="launch" element={<Launch />} >
      <Route path="/" element={<LaunchIndex />} />
      <Route path=":slug" element={<LaunchShoe />} />
